import React from 'react';
import {
    Button,InputGroup, InputGroupAddon, InputGroupText, Input,
  } from 'reactstrap';
import Navig from './Navig';

export default function Home() {
    var white = {
      color: "white"
    }
    var width = {
      width: "300px"
    }
    var margin = {
      marginLeft:"10px"
    }
    var from = {
      marginBottom:"10px",
      width: "300px"
    }
    var time = {
     width: '300px'
    }
    var min = {
      minWidth: '600px'
    }
    return (
      <div className="background">
        <Navig />
        <div className="container">
          <div className="flex">
            <div className="row">
              <h1 className="display-3 text-center" style={white}>FIND A TRIP</h1>
            </div>
            <div className="row">
              <InputGroup style={from}>
                <InputGroupAddon addonType="prepend">
                  <InputGroupText>From</InputGroupText>
                </InputGroupAddon>
                <Input placeholder="Your Location" />
              </InputGroup>
              <InputGroup style={time}>
                <InputGroupAddon addonType="prepend">
                  <InputGroupText>In Between</InputGroupText>
                </InputGroupAddon>
                <Input type="date" />
              </InputGroup>
            </div>
            <div className="row" style={min}>
              <InputGroup style={width}>
                  <InputGroupAddon addonType="prepend">
                    <InputGroupText>To</InputGroupText>
                  </InputGroupAddon>
                  <Input placeholder="Destination" />
              </InputGroup>
              <input style={margin} type="date" ></input>
              <Button style={margin}>Search</Button>
            </div>
          </div>
        </div>
      </div>
    );
  }
